import React, { useState } from "react";

function App(){

    const[test, setTest] = useState([]);

    let getFromServer = () =>{
        fetch('http://localhost:8081/').then(response =>{
            if (!response.ok){
                throw new Error('err: ${response.status}')
            }
            response.json().then(data=>{
                console.log(data)
                for (let i of data){
                    let tmp = [...test, i['title'] ]
                    console.log(i['title'])
                    setTest(tmp);
                    console.log(test)
                }


            })
        })
    }

    return(
        <div>
            <h1>{test}</h1>
            <button onClick={getFromServer} >Send Data</button> 
        </div>
    )
}

export default App
